import { ArrowLeftOutlined, ArrowRightAltOutlined } from "@mui/icons-material"
import styled from "styled-components"

const Arrow = styled.button`
border: none;
width: 50px;
height: 50px;
border-radius: 50%;
background-color: teal;
display: grid;
place-content: 'center';
`
const Slider = () => {
  return (
    <div className='slider'>
      <Arrow>
        <ArrowLeftOutlined/>
      </Arrow>
      <Arrow>
        <ArrowRightAltOutlined/>
      </Arrow>
    </div>
  )
}

export default Slider
